import { ApiProperty } from '@nestjs/swagger';
import { Type } from 'class-transformer';
import { IsDate } from 'class-validator';

export class CreateQuestionDto {
  @ApiProperty({
    description: '학생의 질문 내용입니다.',
    type: String,
    example: '공식 유도가 안돼요 ㅠㅠ',
  })
  description: string;

  @ApiProperty({
    description: '문제의 학교 단계입니다. (e.g. 중학교, 고등학교)',
    type: String,
    example: '고등학교',
  })
  schoolLevel: string;

  @ApiProperty({
    description:
      '문제의 학교 과목입니다. (e.g. 수학1, 수학2, 미적분, 확률과통계)',
    type: String,
    example: '수학1',
  })
  schoolSubject: string;

  @ApiProperty({
    description: '대표 사진의 인덱스입니다.',
    type: Number,
    default: 0,
  })
  mainImageIndex: number;

  @ApiProperty({
    description: '문제 사진 파일의 Base64 인코딩입니다.',
    type: Array,
    default: [
      'data:image/png;base64,',
    ],
  })
  images: string[];
}

export class CreateNormalQuestionDto extends CreateQuestionDto {
  @ApiProperty({
    description: '희망하는 과외 시각입니다. (ISO Timestamp)',
    type: Array,
    example: [new Date().toISOString()],
  })
  hopeTutoringTime?: string[];

  @ApiProperty({
    description: '즉시 과외를 원하는지 여부입니다.',
    type: Boolean,
    example: true,
  })
  hopeImmediately: boolean;
}

export class CreateSelectedQuestionDto extends CreateQuestionDto {
  @Type(() => Date)
  @IsDate()
  @ApiProperty({
    description: '학생이 원하는 과외 시작 시각입니다. (ISO Timestamp)',
    type: Date,
    example: new Date().toISOString(),
  })
  requestTutoringStartTime?: Date;

  @Type(() => Date)
  @IsDate()
  @ApiProperty({
    description: '학생이 원하는 과외 종료 시각입니다. (ISO Timestamp)',
    type: Date,
    example: new Date().toISOString(),
  })
  requestTutoringEndTime?: Date;

  @ApiProperty({
    description: '질문을 받는 선생님의 아이디',
  })
  requestTeacherId?: string;
}
